import Card from "./Card";
import { Link } from "react-router-dom";
import "../../styles/layout/preview.scss";

function DetailCard ({cardFound}){
    return (
        <>
            <section className='preview'>
                <img className='image' src={cardFound.photo ? cardFound.photo : cover} alt= {cardFound.name }/>
                <Card data={cardFound}></Card>
                <Link className="buttons" to='/'>Ver proyectos</Link>
            </section>
        </>
    )
};

export default DetailCard;
